import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar({ activeNav }) {
  return (
    <nav className="navbar">
      <ul className="nav-list">
        <li>
          <Link 
            to="/home" 
            className={activeNav === 'HOME' ? 'active' : ''}
            style={{ color: activeNav === 'HOME' ? '#1e1e1e' : '#fec301' }}
          >
            Home
          </Link>
        </li>
        <li>
          <Link 
            to="/day1-ap-tg" 
            className={activeNav === 'DAY 1 AP TG' ? 'active' : ''}
            style={{ color: activeNav === 'DAY 1 AP TG' ? '#1e1e1e' : '#fec301' }}
          >
            Day 1 AP TG
          </Link>
        </li>
        <li>
          <Link 
            to="/contact" 
            className={activeNav === 'CONTACT' ? 'active' : ''}
            style={{ color: activeNav === 'CONTACT' ? '#1e1e1e' : '#fec301' }}
          >
            Contact
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
